import React from 'react';
import '../../css/tweets/TweetEditMenu.js';

class TweetEditMenu extends React.Component {

    render() {

        return (
            <div className="TweetBtnContainer">
                <div className="TweetBtn">CANCEL</div>
                <input type="submit" className="TweetBtn">CONFIRM</input>
            </div>
        );

    }
}
